import React, { Component } from 'react'

type PostProps = {
    title: string;
    description: string;
}

export default class Post extends Component {
  render() {
    return (
      <div className='p-6 mt-5 border border-stone-700 w-full'>
        <h3 className='text-center pb-3'>Title</h3>
        <p>Description</p>
        <span className='w-full mt-3 flex space-x-3'>
            <span className='px-6 py-2 border border-stone-700 rounded cursor-pointer'>
                <h4>Tag 1</h4>
            </span>
            <span className='px-6 py-2 border border-stone-700 rounded cursor-pointer'>
                <h4>Tag 2</h4>
            </span>
            <span className='px-6 py-2 border border-stone-700 rounded cursor-pointer'>
                <h4>Tag 3</h4>
            </span>
        </span>
      </div>
    )
  }
}
